<?php
	/*	查询影讯查询	*/
	//	http://apistore.baidu.com/apiworks/servicedetail/189.html
	header("content-type:text/html;charset=utf-8");
    $ch = curl_init();
    $url = 'http://apis.baidu.com/baidu_openkg/xiaoshuo_kg/xiaoshuo_kg';
    $header = array(
        'Content-Type:application/x-www-form-urlencoded',
        'apikey:071a862c94e9eb0975f0f3d1c8f9027e',
    );
    $data = "{"query": "大主宰", "resource": "spo_novel"}";
    // 添加apikey到header
    curl_setopt($ch, CURLOPT_HTTPHEADER  , $header);
    // 添加参数
    curl_setopt($ch, CURLOPT_POSTFIELDS, $data);
    curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);
    // 执行HTTP请求
    curl_setopt($ch , CURLOPT_URL , $url);
    $res = curl_exec($ch);

    var_dump(json_decode($res));
?>